import React from "react";

function Two_Card_Product(){
    return(
        <>
        <div className="v_box">
            <div className="v_box1">
                <div className="v_image"></div>
                <div className="v_offer"></div>
                <div className="v_image"></div>
                <div className="v_image"></div>
            </div>
        </div>
        </>
    );
}

export default Two_Card_Product;
